function() {
	var inputField = document.getElementById("keyword");
	var keyword = inputField.value || "";
            keyword = keyword.toLowerCase();
	var myOption = "";
        var result = "/library/lor/catalogwidget/searchwidget.html";
	var selectId = "searchType";
		try {
			var options = document.getElementById(selectId).options;
			for (var i = 0;i < options.length;i++){
				if(options[i].selected) {
					myOption = options[i].text;
					}
				}
        if (keyword != ""){
             result = "/library/lor/catalogwidget/searchwidget.html?q=" + keyword + "&c=" + myOption;
        }
			} catch(e) {}

 	return result;
}
